import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import closeIcon from '../assets/images/close-cross-in-circular-outlined-interface-button.png';

export default class EventCreator extends Component {
    render() {
        return (
            <div className="evntAddFormCont">
                <div className="eventAdderForm">
                    <Link style={{position: "relative", bottom: "15px"}} to="/" ><img src={closeIcon} alt="close"></img></Link>
                    <form>
                        <label htmlFor="title">Event Name: </label>
                        <input type="text" placeholder="Your mommas birthday" />
                        <br></br>
                        <br></br>
                        <label htmlFor="date">Day of Event:</label>
                        <input id="date" type="date" />
                    </form>
                </div>
            </div>
        )
    }
}
